import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor(){
    super();

    this.state = {
      houses: [
        {
          name: 'Cumbres III'
        },
        {
          name: 'Campanario'
        },
        {
          name: 'Otra casa mas'
        }
      ]
    };
  }

  render() {
    return (
      <div className="App">
      {
        this.state.houses.map(house => <h1> {house.name} </h1>)
      }
      </div>
    )
  }
}

export default App;
